	local var_359_1 = var_0_102.objInfo[var_0_102.selObj.v + 1].model
	local var_359_2 = var_0_102.objInfo[var_0_102.selObj.v + 1].lenght + var_0_102.osLengh.v
	local var_359_3 = var_0_102.objInfo[var_0_102.selObj.v + 1].height + var_0_102.osHeight.v
	local var_359_4 = var_0_102.objInfo[var_0_102.selObj.v + 1].width + var_0_102.osWidth.v
	local var_359_5 = tonumber(var_0_102.height.v)
