	local var_359_8 = var_0_102.pos.v[3]
	local var_359_9 = tonumber(var_0_102.rotZ.v)

	if var_0_102.type.v == 2 then
		lua_thread.create(function()
			for iter_360_0 = 1, var_359_0[2] do
				local var_360_0 = math.rad(var_359_9)
				local var_360_1 = (var_359_2 * iter_360_0 - var_359_2 / 2) * math.cos(var_360_0)
				local var_360_2 = (var_359_2 * iter_360_0 - var_359_2 / 2) * math.sin(var_360_0)

				for iter_360_1 = 1, var_359_0[1] do
