					local var_360_3 = var_359_4 * iter_360_1 - var_359_4 / 2
					local var_360_4 = math.rad(var_359_9 + 90)
					local var_360_5 = var_360_3 * math.cos(var_360_4)
					local var_360_6 = var_360_3 * math.sin(var_360_4)

