function tools_start_inizializirt()
	if not isSampLoaded() or not isSampfuncsLoaded() then
		return
	end

	while not isSampAvailable() do
		wait(100)
	end

	while not sampIsLocalPlayerSpawned() do
		wait(0)
	end

	if not checkip() then
		chatError("Запуск невозможен! Скрипт работает только на серверах проекта {0300FF}S{0255EE}p{01AADC}e{00FFCB}c{00FF8D}t{00FF4F}e{00FF11}r")
		chatInfo("Скрипт был {00BFFF}выгружен{ffffff}.")
		thisScript():unload()
		print("ARIZONA TOOLS is off")
	else
		chatWarning("Скрипт начал свою работу на {0300FF}S{0255EE}p{01AADC}e{00FFCB}c{00FF8D}t{00FF4F}e{00FF11}r")
		chatInfo("Основное меню скрипта: {00BFFF}/amenu")
		print("Script is started on " .. servername)
		push(2, "Сервер успешно инициаллизирован!")
	end

	if thisScript().filename ~= "arztools.luac" and thisScript().filename ~= "arztools.lua" then
		chatError("Изменять название скрипта запрещено! Скрипт выгружен.")
		chatInfo("Верните изначальное название скрипта {00BFFF}arztools.luac")
		thisScript():unload()
	else
		print("Name script is accepted")
	end
end